import React, { Component } from 'react';

class Check extends Component {
    state = { 
        isLogged:true
     }
    render() { 
        return this.state.isLogged ? (
            <div>
                hello hamim
            </div>
        ) : (
            <div>
                hello guest
            </div>
        )
    }
}

export default Check;
